    <View style={{flex:1, flexDirection: 'column'}}> 
      <Text style={{height:200, width:412, backgroundColor:'#ffff00', justifyContent: 'top'}}> 
      <h1>Qual sua altura ?</h1>  
      </Text>
      <Text style={{height:200, width:412,backgroundColor:'#008000', color:'#fff',borderradius: '300' , justifyContent: 'top', flex: 'center'}}> 
         <h1>Qual seu peso ?</h1> 
      </Text>
    </View>
  );
}


export default App;
